import { text } from "node:stream/consumers";

interface Props {
  text: string;
}

function Banner(props: Props) {
  return (
    <div className="Banner">
      <div className="bg-gray-200 mr-6 rounded-md mt-4">
        <p>{props.text}</p>
      </div>
    </div>
  );
}

export default Banner;
